import React from 'react';
import style from './style.module.scss';

const Buttons = () => {
    const object = [1, 2, 3, 4, 5, 6, 7, 8, 9, 0, '00'];
    const map = object.map((item) => <li key={item}>{item}</li>)
    return (
        <div className={style.Buttons}>
            <ul>
                {map}
            </ul>
        </div>
    )
}

export default Buttons;
